import React from 'react';

const App = () => {
    return (
        <div>
            <header>
                <button>Home</button>
                <button>Products</button>
                <button>Pricing</button>
            </header>
            <main>
                <h1>Welcome to My React App</h1>
            </main>
        </div>
    );
};

export default App;
